def decode_ascii_string(encoded_string):
    # Separar los números por puntos y convertir cada uno en su carácter ASCII
    decoded_chars = [chr(int(num) + 4) for num in encoded_string.split('.')]
    # Unir los caracteres en una cadena final
    decoded_string = ''.join(decoded_chars)
    return decoded_string

